import './Loudoc.css';
const Louheader = () => {
  return (
    <header>
    <div className='we'>
    <br></br>
    <h2 className='qw'>DOCUMENT SUBMISSIO</h2>
    <br></br>
    <br></br>
    </div>
    </header>
  );
};

export default Louheader;
